import React from "react";
import Section3Image from "./Images/3.jpg";

const PlayerPage = () => (
  <div
    style={{  
      backgroundImage: `url(${Section3Image})`,
      backgroundPosition: 'center',
      backgroundSize: 'cover',
      backgroundRepeat: 'no-repeat',
      height: '130%',
    }}
  >
  </div>
);

export default PlayerPage;
